(()=>{"use strict";console.log("Welcome to the TypeScript Vanilla Project");const e=document.querySelector("#count-value"),t=document.querySelector("#btn-add"),n=document.querySelector("#btn-remove");t.addEventListener("click",(()=>{let t=parseInt(e.innerText);const n=(e=>++e)(t).toString();console.log("Button + => "+n+"( was "+t+" )"),e.innerText=n})),n.addEventListener("click",(()=>{const t=(n=parseInt(e.innerText),--n).toString();var n;console.log("Button - => "+t),e.innerText=t}))})();